  \"2013-12-07T09:04:56.982249\",\n\t\"name\": \"bismarck-mandan-aerial-photography-2013\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Ayres Associates provided the Bismarck-Mandan
  Metropolitan Planning Organization (hereinafter referred to as the MPO) with digital
  color orthophotography and topographic mapping services in 2013. Digital aerial
  imagery was collected on May 2 and 3, 2013 using an Intergraph DMC, digital photogrammetric
  mapping camera. Imagery was collected to support 6-inch resolution digital orthoimagery
  to National Map Accuracy Standards for 1\" = 100' map scale. Resultant orthoimagery
  was rectified to a new digital terrain model, comprising of a newly developed LiDAR
  bare earth surface. Orthoimagery was delivered according to the MPO's standard tile
  schematic. The Bismarck-Mandan MPO is a certified planning entity in the State of
  North Dakota and is comprised of the City of Bismarck, City of Mandan, City of Lincoln,
  and portions of Burleigh and Morton Counties. The Bismarck-Mandan Metropolitan area
  is located in Burleigh and Morton Counties, in the south central region of North
  Dakota. The area covers approximately 395 square miles and is home to over 100,000
  people.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
